const position = [3.9, 2.95, 3.65 ]
const rotation = [0, 70, 0]
const bg = '#FFAE00'
const blend = 'Combine'

let clicked = false

feature.on('click', () => {
  const sign = parcel.getFeatureById('pineapple-sign')

  if (sign) {
    parcel.removeFeature(sign)
  }

  clicked = true

  const newSign = parcel.createFeature('sign')
  newSign.set({scale:[2, 0.3, 0.5]})
  newSign.set({position:position})
  newSign.set({rotation:rotation})
  newSign.set({background:bg})
  newSign.set({blendMode:blend})
  newSign.set({text:'learn some glossary for juicebox'})

  setTimeout(() => {
    parcel.removeFeature(newSign)
    clicked = false  
  }, 3000)
})

